import sys
def sum_digits(n):
    s = 0
    while n:
        n, r = divmod(n, 10)
        s += r
    return s
def sum_digits2(n):
    digits = str(n)
    s = 0
    for c in digits:
        s += ord(c) - ord('0')
    return s
def sum_digits3(n):
    s = 0
    while n:
        r = n % 10
        n = n // 10
        s = s + r
    return s
